import React from 'react';
import "./AgentFilter.css";
import { Link } from "react-router-dom";

let clientes = [
    {
        nombre: 'Angel Bosquez',
        id: '345605',
        role: 'Agent'
    },

    {
        nombre: 'Diego Hernández',
        id: '345604',
        role: 'Agent'
    },

    {
        nombre: 'Fernanda Cazado',
        id: '345602',
        role: 'Agent'
    },

    {
        nombre: 'José Pedraza',
        id: '345601',
        role: 'Agent'
    },

    {
        nombre: 'Luis Orozco',
        id: '345603',
        role: 'Agent'
    },                
];

export default function AgentFilter() {

        return(

                <div>

                    <div className='upperBox'>
                            <h1>Agents</h1>
                                <div className='searchBox'>
                                    <input type="text" placeholder="Search.." name="search"/>
                                    <button type="submit"><i class="fa fa-search"></i></button>   
                                </div>
                    </div>
                    <div className='middleBox'></div>

                    <div className = 'agentsInfo'>
                        <ol>    
                            {
                                clientes.map((agentes, iterador) => {
                                    return(
                                        <li className = 'agents' key = {iterador}>
                                            <i class='bx bx-group icon' ></i>
                                                {/* <Link to={`/agents/estadisticas/${agentes.id}`}> */}

                                                {/* <Link to={`/agents/${agentes.id}`}> */}
                                                <Link to={`/agents/${agentes.id}`}>
                                                    <div className='name'>
                                                        {agentes.nombre}
                                                    </div>
                                                </Link>

                                                -
                                                <div className='id'>
                                                    {agentes.id}
                                                </div>
                                            <br></br>
                                            <div className='role'>
                                            {agentes.role}
                                            </div>
                                            <br></br>
                                        </li>
                                    );
                                })
                            }
                        </ol>    
                    </div>
                </div>
        );
}
